import React from 'react';
import './Home.css';
import { bannerImageUrl } from '../../data';

function Home() {
    return (
        <div className="banner-image">
            <img src={bannerImageUrl} className="banner-image" alt="banner image" />
        </div>
    )
}

export default Home
